import { Layout, Menu } from "antd";
import "antd/dist/antd.css";
import { useState } from "react";
import {UserOutlined} from '@ant-design/icons';
import Page from "./Page";
import Login from "./Login";

const Navbar = () => {
  const [state, setstate] = useState({ keys: "" });

  const handleClick = (event) => {
      setstate({...state, key: event.key});
    console.log(event.key);
  };

  const labels = [
    {
        key : "I1",
        action : (event) => handleClick(<Page title="Item 1"/>),
        title : "Item 1",
        component : <Page title="Item 1"/>
    },

    {
        key : "I2",
        action : (event) => handleClick(<Page title="Item 2"/>),
        title : "Item 2",
        component : <Page title="Item 1"/>
    },
    {
        key : "connexion",
        action : (event) => handleClick(<Login/>),
        title : "Connexion",
        icon : <UserOutlined/>
    },
  ];
  return (
    <Layout.Header>
      <Menu mode="horizontal" defaultSelectedKeys={["I1"]}>
        <Menu.Item
          key="I1"
          onClick={(event) => handleClick(event)}
        >
          Item 1
        </Menu.Item>

        <Menu.Item
          key="I2"
          onClick={(event) => console.log(event.key)}
        >
          Item 2
        </Menu.Item>
        <Menu.Item
          key="connexion"
          onClick={(event) => console.log(event.key)}
        >
          <UserOutlined/> Connexion
        </Menu.Item>
      </Menu>
    </Layout.Header>
  );
}
export default Navbar;
